// javaScript object
const initialState = {
    logs: null,
    current: null,
    loading: false,
    error: null
}

export default (state = initialState, action) => {
    switch (action.type) {
        case "ADD": {
            return {
                count: state.count + 1
            }
        }
        case "SUB": {
            return {
                count: state.count - 1
            }
        }
        default: return state

    }
}
